function Suggester(e){this.process=function(e){var t=[];for(var n=0;n<e.length;n++)t[n]=[n,e[n]];var r=0;var i;while(t.length>0){var s=[];for(var o=0;o<t.length;o++){i=t[o][1].substring(0,r+1);if(this.dict[i]===undefined)this.dict[i]=[];this.dict[i].push(t[o][0]);if(i.length==t[o][1].length)s.push(o)}for(var u=s.length-1;u>=0;u--)t.splice(s[u],1);r++}};this.suggest=function(e){if(this.dict[e]===undefined)return null;var t=[];for(var n=0;n<this.dict[e].length;n++)t.push(this.list[this.dict[e][n]]);return t};this.load=function(e){this.list=e;this.dict={};this.process(this.list)};this.list=e;this.dict={};this.process(this.list)}